        <div className="absolute bottom-20 right-10 w-60 h-60 bg-gradient-to-l from-emerald-500/10 to-teal-500/10 rounded-full animate-bounce" style={{animationDuration: '8s'}}></div>
      </div>
    </>
  );
};

